import styled from "@emotion/styled/types/base";
import { Box, Button } from "@mui/material";

const LoginButton = styled(Box)`
  margin-left: 10px;

`;

const CustomButtons = () => {
    return (
        <LoginButton>
           <Button variant="contained">Login</Button>
        
          
        </LoginButton>
    )



}

export default CustomButtons;
